import React from "react";
import './App.css';
import FullProject from "./parts/FullProject";
import { HashRouter, Switch, Route } from 'react-router-dom'
import Nav from "./parts/Nav";

function App() {
    return (
        <HashRouter>
            <Nav/>
            <Switch>
                <Route exact path={"/"} component={FullProject} />
                <Route path={"/books"} component={FullProject} />
            </Switch>
        </HashRouter>
    )
}
export default App;
